import React, { useState, useEffect } from "react"
import '../App.css'
import Table from 'react-bootstrap/Table';
import axios from "axios";


const ShowSelectedRestaurant = () => {

  const [data, setData] = useState([]);

    const savedSession = localStorage.getItem('restaurantFinderSessionId');
    const sessionId = JSON.parse(savedSession);
  try {
    axios
    .post(`http://localhost:8080/restaurant/api/v1/getSelectedRestaurant/${sessionId}`)
      .then((response) => {
        setData({
        restaurantName: response.data.restaurantName,
        restaurantAddedBy: response.data.restaurantName,
        sessionId: response.data.sessionId,
        statusCode: response.data.statusCode,
        message: response.data.message
        });
        console.log(response);
        console.log(response.data);
      });

  } catch (error) {
    console.error("Error fetching data:", error);
    window.location = "/error"; 
  }

  useEffect(() => {
    axios
      .get(`http://localhost:8080/restaurant/api/v1/getSelectedRestaurant/${sessionId}`)
      .then((res) => {
        setData(res.data);
      })
      .catch((err) => console.log(err));
  }, []);


if(data.statusCode ==200) {
  return (
    <Table striped bordered hover size="sm">
      <thead>
            <tr>
                <th>restaurantName</th>
                 <th>restaurantAddedBy</th>
                 <th>sessionId</th>
            </tr>
        </thead>
        <tbody>
            {
                 <tr key={data.restaurantName}>
                 <td>{data.restaurantName}</td>
                 <td>{data.restaurantAddedBy}</td>
                 <td>{data.sessionId}</td>
               </tr>
            }
        </tbody>
    </Table>
  );
} else {
  return (
    <Table striped bordered hover size="sm">
      <thead>
        <tr>
          <th>Message</th>
        </tr>
      </thead>

      <tbody>
        {
          <tr key={data.message}>
            <td>{data.message}</td>
          </tr>
        }
      </tbody>
    </Table>
  );
}
}
export default ShowSelectedRestaurant;
